import React from 'react'
import '../../assets/Data/videos.json'



export default function NextVideo({ video }) {
    return (
        <div className='next'>
            <p className='next__title'>NEXT VIDEO</p>
            {video.map( video =>(
                <div key={video.id}>
                    <img src={video.image} alt=''></img>
                    <p>{video.title}</p>
                    <p>{video.channel}</p>
                </div>
                )
                )}
        </div>
    )
}
